text:'{"blocks":[{"key":"1re6t","text":"Assistive technology can be hardware, software or other systems that help a user with a disability — whether that is a vision, hearing, mobility or cognitive impairment — to access the digital world. These tools can be as simple as a keyboard on the computer. Some people with disabilities that affect movement, like injuries or Parkinson’s, may be unable to use a mouse, so the keyboard becomes the primary tool to use the computer. If a person has a visual impairment, a dark or high contrast mode may make it easier to see content on a phone screen, or they might use software called a screen reader that announces the text and items on the screen.","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":651,"style":"textHighlightEnable:false"},{"offset":0,"length":651,"style":"textShadowEnable:false"},{"offset":0,"length":651,"style":"overridden:false"},{"offset":0,"length":651,"style":"hlnk:"},{"offset":0,"length":651,"style":"hlnkt:wp"},{"offset":0,"length":651,"style":"textOutlineEnable:false"},{"offset":0,"length":651,"style":"opacity:1"},{"offset":0,"length":651,"style":"hlnke:true"},{"offset":0,"length":651,"style":"backgroundColor:unset"},{"offset":0,"length":651,"style":"defaultBackgroundColor:#E8D01B"}],"entityRanges":[],"data":{"listType":"S_Bullets08","listColor":"#666666","listIndent":"100%","listSize":"100%","listDepth":"0","overridden":"false","presetId":"text-body-2"}}],"entityMap":{}}',
